import { useEffect } from 'react';
import { Box } from '@mui/material';
import { SectionWrapper, TitleWrapper } from '../../../styles/sectionStyles.tsx';
import Certifications from '../../../data/Certifications.json';
import { Certification } from './Certification.tsx';

export const CertificationsContainer = () => {
	useEffect(() => {
		window.scrollTo(0, 0);
	}, []);

	return (
		<SectionWrapper>
			<TitleWrapper>LICENSES & CERTIFICATIONS</TitleWrapper>
			<Box>
				{Certifications.map((cert) => (
					<Certification certificate={cert} key={cert.name} />
				))}
			</Box>
		</SectionWrapper>
	);
};
